def mystery(n):
    s = 0
    for i in range(1, n+1):
        if i % 3 == 1:
            s += i * (i ^ (i-1))
        elif i % 3 == 2:
            s += (i & (i-1)) - (i | (i-1))
        else:
            s += ((i * 7) % 13) - ((i * 5) % 11)
    return s

What is the value returned by mystery(123)?

Your answer should be a single integer.

